function RecentWinnersHeader(props) {
    return (
        <>
            <td className={"recent-winners-th"}>{props.header.address}</td>
            <td className={"recent-winners-th"}>{props.header.fee}</td>
            <td className={"recent-winners-th"}>{props.header.entrance_date}</td>
            <td className={"recent-winners-th"}>{props.header.won}</td>
            <td className={"recent-winners-th"}>{props.header.date}</td>
        </>
    );
}

export default RecentWinnersHeader;
